data.value:
Tento příkaz bude proveden, jakmile acs.exe skončí, ale před načtením všech výsledkových json souborů.

Hodnoty pro nahrazení:
 [b][mono]{type}[/mono][/b] — typ závodu;
 [b][mono]{car}[/mono][/b] — název auta;
 [b][mono]{car.id}[/mono][/b] — ID auta;
 [b][mono]{track}[/mono][/b] — název trati;
 [b][mono]{track.id}[/mono][/b] — ID trati.

Potřebujete-li některé další hodnoty, kontaktujte nás prosím a my je přidáme.

Jako pracovní složka bude použita složka Assetto Corsa v Dokumentech.

Tento příkaz bude proveden před startem acs.exe, ale po nastavení všech inicializačních souborů.

Hodnoty pro nahrazení:
 [b][mono]{type}[/mono][/b] — typ závodu;
 [b][mono]{car}[/mono][/b] — název auta;
 [b][mono]{car.id}[/mono][/b] — ID auta;
 [b][mono]{track}[/mono][/b] — název trati;
 [b][mono]{track.id}[/mono][/b] — ID trati.

Potřebujete-li některé další hodnoty, kontaktujte nás prosím a my je přidáme.

Jako pracovní složka bude použita složka Assetto Corsa v Dokumentech.

Ostatní vlivy barev na oblaky:
 • [b]0%:[/b] berou se v úvahu jen efekty barev na oblaky;
 • [b]50%:[/b] 50 % barvy oblak a 50 % efektů;
 • [b]100%:[/b] bere se v úvahu jen barva oblaků

Používá se pro ukládání nebo automatické ukládání opakovaných záznamů po jízdě.

Hodnoty pro nahrazení:
 [b][mono]{type}[/mono][/b] — typ závodu;
 [b][mono]{car}[/mono][/b] — název auta;
 [b][mono]{car.id}[/mono][/b] — ID auta;
 [b][mono]{track}[/mono][/b] — název trati;
 [b][mono]{track.id}[/mono][/b] — Id trati;
 [b][mono]{date}[/mono][/b] — datum a denní doba v náležitém formátu;
 [b][mono]{date_ac}[/mono][/b] — datum a denní doba ve formátu videohry.

Proměnné:
 [b][mono]{…:l}[/mono][/b] — malými;
 [b][mono]{…:u}[/mono][/b] — velkými;
 [b][mono]{…:0}[/mono][/b] — jen první symbol.

Příklady:
 [b][mono]{car.id}_{track.id}_{date_ac}[/mono][/b] — výchozí formát Kunosu;
 [b][mono]({type:l0}) {car:l} on {track:l}.acreplay[/mono][/b] — něco jako “[w] bmw m3 e30 on brands hatch.acreplay”.

Chcete-li nějaké další hodnoty, kontaktujte nás prosím a my je přidáme.

[b]Varování[/b]:
Nepoužívejte symbol “[” nebo “]”!
